import React from "react";
const SeviceCard = ({serviceDataProps}) => {
    console.log(serviceDataProps);
    return (
        <>
            <section id="Section1">
            
            <div className="bg-dark text-light">
            <h1 className="p-5 text-center">Services</h1>
            <div className="container">
                
                <div className="row">
        {serviceDataProps.map((curEl)=>{
 
          return(
           
            <div className="col-sm-4 text-secondary">
         
    <div className="card container">
        <p className="text-center service-icon"><i className="fas fa-layer-group "></i></p>
      <div className="card-body text-start">
        <h3 className="card-title">Development</h3>
        <p className="lh-lg text-start">
          I have great expertise of web development.
          I provide my services in all kind of web
          developement.
        </p>
       </div>
  
    </div>
  </div>
 
 
           
          )   

        })}
        </div>
            </div>
        </div>
        </section>
        </>
    )
}

export default SeviceCard;
